import { TransactionHistoryTableEl } from "./TransactionHistory/TransactionHistory";
import friends from './friends.json'
export const App = () => {
  return (<div>
      <ProfileEl/>
      <StatisticsEl/>
      <FriendListEl friends={friends}/>
      <TransactionHistoryTableEl/>
      <GlobalSryles/>
  </div>  
)
};
